import { useState } from "react";

function Manga(props) {

  return(
    <div className='card'>
          {/* <img src={props.mangaShow.image} alt='broken' /> */}
          <ul className="list-group list-group-flush">
            <li className='list-group-item'>{props.mangaShow.name}</li>
            {/* <li className='list-group-item'>{props.mangaShow.by}</li>
            <li className='list-group-item'>Started in {props.mangaShow.mangaStart}</li> */}
          </ul>   
        </div>
  )};

export default Manga;
